import React, { useState } from "react";
import { Link } from "react-router-dom";
import "./NavBar.css";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faCircleXmark, faBars } from "@fortawesome/free-solid-svg-icons";

function NavBar() {
    const [click, setClick] = useState(false);

    const handleClick = () => setClick(!click);
    const closeMenu = () => setClick(false);
    return (
        <>
            <nav className="navbar">
                <div>
                    <Link to="/">
                        PASKAA <i className="fab fa-typo3" />
                    </Link>
                    <div className="menuicon" onClick={handleClick}>
                        <i className={click ? <FontAwesomeIcon icon={faCircleXmark} /> : <FontAwesomeIcon icon={faBars} />} />
                    </div>
                    <ul className={click ? 'nav-menu activate' : 'nav-menu'}>
                        <li className="nav-item">
                            <Link to='/' className='nav-links' onClick={closeMenu}>
                                Home
                            </Link>
                        </li>
                    </ul>

                </div>

            </nav>
        </>
    );
}
export default NavBar;
